INSERT INTO `mesages` (`mesage_id`, `Mesage`, `Author`, `Date`) VALUES
(2, 'Ань, у нас с Виктором Николаевичем возникли проблемы при попытке переименовать поток ЭВМв в ЭВМд ("Internal server error") и еще при просмотре потоков в некоторых строчках не выводятся номер курса. Я не знаю может Виктор Николаевич уже пробовал оставить тебе это сообщение, тогда я повторяюсь', 'Илдар', '14:37 Понедельник 27.10.2003'),
(1, 'Проверка', 'Илдар', '14:34 Понедельник 27.10.2003'),
(3, 'В справочнике потоков несколько глюков:\r\n1) В правом столбце меню специальностей: а) показывает данные не из справочника специальностей; б) против ЭВМд стоит почему-то не 220100, а 215000\r\n2) После добавления новой пустой записи, попытка ее удалить привела к Internal Error.', 'nvn', '18:07 Понедельник 27.10.2003'),
(4, 'Еще замечания по справочнику потоков: \r\n1. В первых записях нет номера курса\r\n2. Нет возможности указать, что МЭВМд-51 работает по одному плану, а МЭВМд-52 - по другому. ', 'nvn', '18:11 Понедельник 27.10.2003'),
(5, 'Аня,если дисциплина идет несколько семестров и в семестрах разное количество занятий в неделю,то общий объем занятий в семестр  должен быть разный, а программа ставит во всех семестрах один. ', 'Галина Владимировна каф.ИС', '13:02 Thursday 18.12.2003'),
(6, 'Галина Владимировна, так и должно быть. Дело в том что общий объем занятий указывается за всме семестры всумме, хотя и указывается в каждом семестре. Общий объем занятий обозначает сумму аудиторных и самостоятельных за нятий за все семестры.', 'Аня', '12:33 Вторник 23.12.2003'),
(7, '1. В шапке плана инженеров 2000г срок обучения 1 год. Если это число вводится отдельно, то правильно будет организовать контроль через заглядывание внутрь графика учебного процесса, где сидят 10 семестров. Если же это число вычислятся через график, то нужно поправить алгоритм.\r\n2. В управляющем фрейме позиции "Замечания и предложения" и "Добавить замечание" нужно слить в одну "Замечания"(в разделе "Действия" вместо "Добавить замечание"). Пусть эта ссылка сразу запускает диалог добавления замечаний, а на странице этого диалога рядом с кнопкой "Добавить" пусть будет кнопка "Просмотр замечаний". ', 'Негода', '11:25 Четверг 15.04.2004'),
(8, '!!! В списке закрепленных аудиторий неверно считается нагрузка по видам занятий. Не должно быть умножения на число групп. Если 1 час лабораторных работ, то при 17-недельном семестре объем 17 часов. Т.е. умножения недельной наг', 'Негода', '11:48 Понедельник 19.04.2004'),
(9, 'Необходимо министерский код сделать текстовым, чтобы, например, код 071900 \r\nне превращался в 71900', 'Негода', '14:23 Понедельник 19.04.2004'),
(10, 'Нужно в список функций, контролируемых общие проблемы с базой данных, запланировать:\r\n1) Функцию контроля наличия двух разных специальностей с одинаковым кодом\r\n2) Функцию контроля степени покрытия объема заниятий', 'Негода', '14:41 Понедельник 19.04.2004'),
(11, 'В первой строке каждой таблицы закрепления дисциплин за кафедрами вместо цикла дисциплин фигурирует какой-то мусор', 'Негода', '15:18 Понедельник 19.04.2004'),
(12, 'Нужно подумать, как в списке закрепленных десциплин не дублировать те позиции бакалаврских планов, что идут по инженерному плану.', 'Негода', '15:29 Понедельник 19.04.2004'),
(13, '1. Публикация посеместровой нагрузки для пользователей (вход "Учебные планы", а не "Редактор планов") в случае пустого справочника потоков дает только заголовок. Это выглядит как "глюк" программы. Естественнее было бы выдать сообщение: "Не определены потоки для специальности XXXXXX". \r\n2. У тебя есть множество MP_US публикаций, доступных в пользовательском режиме на сайте "Учебные планы", множество MP_EDH html-публикаций, формируемых на сайте "Редактор планов" и множество MP_EDR rtf-публикаций, формируемых там-же. Хорошо бы описать эти множества через перечисления, отметить как-то пересечение этих множеств и задаться вопросом: "Насколько уместно какие-то публикации продублировать на обоих сайтах и в двух форматах". Эта мысль приходит в голову, когда задумываешься "А почему какой-то общезначимый отчет доступен только в редакторе планов и не доступен в пользовательском режиме, почему какой-то отчет доступен только в rtf-формате и не доступен в html-формате?". Выстраивание ответа на первую часть вопроса может даже упростить систему авторизации доступа. Если люди, которым нужно только читать, смогут получать все отчеты через пользовательский режим, то в авторизации доступа нужно будет учитывать только тех, кто может модифицировать. Ответ на вторую часть вопроса, может породить ряд дополнительных публикаций на сайте "Учебные планы", рассчитанные не на печать и подписывание документа, а только на чтение его содержимого. Та же информационная карта нужна студентам и преподавателям для узнавания "Что-же и в какой форме придется сдавать?". ', 'Негода', '17:20 Четверг 13.05.2004'),
(14, 'Аня, у меня копируется (сохраняется для распечатывания) без тех изменений, которые я вношу, как это исправить?\r\n', 'Валентина Анатольевна', '11:28 Понедельник 24.05.2004'),
(15, '1. Все же нужно найти способ сообщения браузеру текущей кодировки. Сейчас постоянно возникает проблема переключения в Windows-кодировку из другой проставленной по умолчанию в навигаторе.\r\n2. Я исправлял учебный план магистров следующим образом: отметил третью запись "иностранный язык" и запустил "копирование отмеченной записи". В результата была порождена новая 4-я по этой дисциплине запись, но если я менял ее содержимое, то после "внести изменения" обнаруживал в 3-й записи полную копию 4-й. Если же вносил изменение в содержимой 3-й записи, то это новое содержимое обнаруживал после фиксации изменений в 4-й записи. Какие-то сиамские близнецы.\r\n3. В другом магистерском плане я изменил "экзамен" на "зачет" в 11-м семестре. Не зафиксировав изменение через "внести изменение" отметил только что измененную в браузере запись и нажал "копировать отмеченную запись". В ответ получил сообщение My SQL "Internal Server Error" и рекомендацию обратиться к администратору сервера kao@ulstu.ru. \r\n4. Долго искал вызов функции распечатки информационной карты, значит, нужно что-то делать для поддержки поиска редко используемых функций. Проще всего сделать слева кнопку "Все rtf-отчеты", которая выводит полный список ссылок на запуск функциональности. Правда, при этом придется кое-где добавлять предварительный диалог выбора объекта для отчета.\r\n5. Запустив функцию распечатки информационной карты, я обнаружил, что у магистров пара дисциплин по выбору "Теоретические основы автоматизации проектирования" и "Системы автоматизации проектирования средств ВТ" попадают в две позиции, порождая лишнее количество экзаменов. Манипуляции с этими двумя записями в редакторе планов ничего не дали.\r\n', 'Негода', '14:08 Пятница 19.11.2004'),
(16, 'Аня, я поменял пароль для edudep, используя системную функцию linux и исправил этот пароль в metauser для edudep. Прошу проверить верность моего решения.', 'Илдар', '15:00 Четверг 27.01.2005'),
(17, '1. Нужно проверить устойчивость входа в систему. Для этого на нескольких станциях попробовать войти под разными именами и поработать. Затем попытать на двух станциях войти под одним логином и поработать. Если отказ доступа порождается тем, что кто-то уже работает под этим логином, либо даже под другим, то эту ситуацию нужно проанализировать и предложить небор технологических решений, сводящих к минимуму число отказов доступа, а относительно ситуаций, когда отказ неизбежен, нужно формировать адекватное сообщение пользователю, чтобы не возникало ощущение, что приложение глючит.\r\n', 'Негода', '11:19 Среда 02.03.2005');
